export default {
  title: 'DHCP settings schema',
  type: 'object',
  properties: {
    dhcpAuthoritative: { type: 'boolean' },
    staticDhcpEntries: {
      type: 'array',
      items: {
        type: 'object',
        properties: {
          address: { type: 'string' },
          description: { type: 'string' },
          macAddress: { type: 'string' },
        },
        additionalProperties: false,
      },
    },
  },
  additionalProperties: false,
}
